import React, { useEffect, useState } from "react";

function GitHubUser({login}) {
    const [data, setData] = useState(null);
    useEffect(() => {
        fetch(`https://api.github.com/users/${login}`)
        .then(res => res.json())
        .then(setData)
        .catch(console.error);
    }, []);

    if(data) {
        return(
            <div>{JSON.stringify(data)}</div>
        )
    }
    return null;
}

export default GitHubUser;
